import Title from './components/titleBar';
import News from './components/news';
import Pagination from './components/pagination';
import './App.css';
import { Routes, Route } from 'react-router-dom';

function App() {
  return (
    <div className="App">
        <Title />
        <Routes>
          <Route path='/' element={<News/>}/>
        </Routes>       
        <Pagination />
    </div>
  );
}

export default App;
